import React from 'react';
import './Erc.css';

function Erc() {
  return (
    <div className="erc-container">
      <img src="" alt="ERC Certification" className="erc-image fade-in" />
      <div className="erc-details fade-in">
        <h2 className="erc-title">ERC Certification</h2>
        <p className="erc-description">
          Our ERC certification highlights our adherence to the highest standards of energy efficiency and environmental sustainability in our manufacturing processes.
        </p>
      </div>
    </div>
  );
}

export default Erc;
